import React from 'react'
import '../profesor.css'
import '../button.css'
import { Link } from 'react-router-dom';

class Profesor extends React.Component{
    render(){
        return(
            <div className="container">
                <h1>Bienvenido al Menu Profesor</h1>
                <Link to="/sistematt"><href className="myButton">Log Out</href></Link>
            </div>
        );
    }
}

export default Profesor;
